import React from "react";

function Navbar (){
    return(
    <div class="navbar">
    <a href="#AboutMe">About</a>
    <a href="#Education">Education</a>
    <a href="#Certifications">Certifications</a>
    <a href="#WorkExperience">Work Experience</a>
    </div>
    );
}

export default Navbar;
